import React from "react";
// import logo from './logo/video-calling-app.png'


export default function navbarComponent(props){

    const handleLoginAuth = () => {
        props.loginAuthPage();
        // props.toggleTranslate();
    }

    const handleSignUpAuth = () => {
        props.signUpAuthPage();
        // props.toggleTranslate();
    }



    return(
        <>
            <div className="navbar-wrapper">
                <div className="navbar-logo-container">
                    {/* <img className="navbar-main-logo" style={{height:'70%', width: '35%'}} src={logo} alt="" /> */}
                    <div style={{color:'white', fontSize:'25px', fontWeight:'bold', cursor:"pointer"}}>Vi Meet</div>
                </div>
                <div className="navbar-items-container">
                        <li><a href="/">Home</a></li>
                        <li><a href="/">About</a></li>
                        <li><a href="/">Support</a></li>
                        <li><a href="/">Apps</a></li>
                </div>
                <div className="navbar-button-container">
                    <button className="navbar-login-button" onClick={handleLoginAuth}>Login</button>
                    <button className="navbar-login-button" onClick={handleSignUpAuth}>Sign Up</button>
                </div>
            </div>
        </>
    )
}
